function getLantern(x: number, y: number): LightSource {
  return {
    id: `${Date.now()}__${Math.random()}`,
    radius: 6,
    rolloff: 8,
    position: {x, y},
  };
}

function getDoor(x: number): Door {
  return {
    fromPosition: {x, y: 0},
    toPosition: {x: 14, y: 18},
    toId: '07',
  };
}

